import { Document, PDFViewer, StyleSheet } from "react-pdf";





const styles = StyleSheet.create(
    {
        page: {
            backgroundColor: 'white',
            color: 'black'
        },

        viewer: {
            width: window.innerWidth,
            height: window.innerHeight
        }

    }
)









const Fatura = (props) => {


    return (
        <PDFViewer styles={styles.viewer}>

            <Document
            error={''}
            file={props.file}
            
            >

            </Document>

        </PDFViewer>
    )
}



export default Fatura;
